import React, {Component} from 'react';
import {Route, Switch} from 'react-router-dom';
import './App.css';
import Layout from "./layout/Layout";
import Button from 'react-bootstrap/Button'

function App() {

    return (
        <div className={"App"}>
            <Layout>
                <Switch>
                <Route exact path ="/" />
                </Switch>
                <div><Button> Test Button </Button></div>
            </Layout>
        </div>
    )

}

export default App;
